import React from "react";
import "../styles/login.css";

export default function Login() {
  return (
      <div class="container-fluid">
        <div class="header">
          <div class="wrap">
              <a href="https://www.sphera.com/" target="_blank">
                <img id="ImgLogo" class="logo" src={require('./images/Sphera%20RO.png')} alt="Sphera logo" />
              </a>
          </div>
        </div>
      </div>
  );
}
